import {FETCH_TREE, ADD_NODE} from '../action/constant';

const INITIAL_STATE = {};


export default (state =INITIAL_STATE, action) => {
    switch (action.type) {
      case FETCH_TREE:
        return action.payload;
      case ADD_NODE :
        return action.payload;
      default:
        return state;
    }
  };
